import React, { useState } from 'react';
import './stylesFiles/createAccount.css';

const CreateAccount = () => {
    const [hasContent, setHasContent] = useState(false);

    const handleBlur = (e) => {
        if (e.target.value !== "") {
            setHasContent(true);
        } else {
            setHasContent(false);
        }
    }

    return (
        <div style={{backgroundImage:"linear-gradient(to top left,black,darkblue)",paddingTop:"5%"}}>
            <h1 style={{fontSize:"4vw"}}>Create Account</h1>
            <form>
                <ul style={{listStyleType:"none", display:"grid", marginTop:"5%"}}>
                    <li style={{gridColumnStart:0, gridColumnEnd:1}}>
                        <input placeholder="First Name" type="email"/>
                    </li>
                    <li style={{gridColumnStart:2, gridColumnEnd:3}}>
                        <input placeholder="Last Name" type="text"/>
                    </li>
                    <li>
                        <input style={{gridColumnStart:1, gridColumnEnd:2}} placeholder="Email Address" type="text"/>
                    </li>
                    <li>
                        <label htmlFor="cars">Which position do you play:</label>
                        <select name="cars" id="cars">
                            <option value="ATT">Attacker</option>
                            <option value="MID">Midfielder</option>
                            <option value="DEF">Defender</option>
                            <option value="G">Goalkeeper</option>
                        </select>
                    </li>
                </ul>
            </form>

        </div>
    );
}

export default CreateAccount;
